  render: () => <>
      <TopNav title="Carleton University" />
      <Banner title="cutheme news card testing" isType="dark-wave" align="left" />

      <Main>
        <Section hasProse>
          <DoublePara />

          <h2>News Card Block</h2>
          <SinglePara />

          <Container bgColor="white" hasProse>
            <Column cols="3">
              {data.map(item => <NewsCard key={item.id} title={item?.title} link={item?.link} image={item?.image} date={item?.date} excerpt={item?.excerpt} tags={item?.tags} />)}
            </Column>
          </Container>

          <DoublePara />

          <h2>News Card Block with Grey Bg</h2>
          <SinglePara />

          <Container bgColor="grey" hasProse>
            <Column cols="3">
              {data.map(item => <NewsCard key={item.id} title={item?.title} link={item?.link} image={item?.image} date={item?.date} excerpt={item?.excerpt} tags={item?.tags} />)}
            </Column>
          </Container>

          <h2>Consecutive News Card Block</h2>
          <SinglePara />

          <Container bgColor="white" hasProse>
            <Column cols="3">
              {data.map(item => <NewsCard key={item.id} title={item?.title} link={item?.link} image={item?.image} date={item?.date} excerpt={item?.excerpt} tags={item?.tags} />)}
            </Column>
          </Container>

          <Container bgColor="white" maxWidth="5xl" hasProse>
            <Column cols="3" maxWidth="7xl">
              {data.map(item => <NewsCard key={item.id} title={item?.title} link={item?.link} image={item?.image} date={item?.date} excerpt={item?.excerpt} tags={item?.tags} />)}
            </Column>
          </Container>

          <h2>Consecutive News Card Block with Grey Bg</h2>
          <SinglePara />

          <Container bgColor="grey" maxWidth="5xl" hasProse>
            <Column cols="3">
              {data.map(item => <NewsCard key={item.id} title={item?.title} link={item?.link} image={item?.image} date={item?.date} excerpt={item?.excerpt} tags={item?.tags} />)}
            </Column>
          </Container>

          <Container bgColor="grey" hasProse>
            <Column cols="3" maxWidth="7xl">
              {data.map(item => <NewsCard key={item.id} title={item?.title} link={item?.link} image={item?.image} date={item?.date} excerpt={item?.excerpt} tags={item?.tags} />)}
            </Column>
          </Container>
        </Section>
      </Main>

      <FooterBasic />
    </>
